import React from 'react'
import { useState } from 'react';

const Projects = () => {
    const [activeFilter, setActiveFilter] = useState('All');
    const [isDarkMode, setIsDarkMode] = useState(false);
    const toggleTheme = () => {
      setIsDarkMode(!isDarkMode);
      document.documentElement.classList.toggle('dark');
    };
  return (
      <div>
          <section id="projects" className={`py-20 ${isDarkMode ? 'bg-gray-800' : 'bg-white'} transition-colors duration-300`}>
<div className="container mx-auto px-4 sm:px-6">
<div className="text-center mb-16">
<h2 className="text-3xl md:text-4xl font-bold text-gray-800 mb-4">Featured Projects</h2>
<p className="text-lg text-gray-600 max-w-2xl mx-auto">
A collection of my recent work showcasing my skills in frontend development, responsive design, and modern UI/UX principles.
</p>
</div>
{/* Project Filters */}
<div className="flex flex-wrap justify-center mb-8 sm:mb-12 gap-2 sm:gap-3">
{['All', 'React', 'Vue', 'TypeScript', 'E-commerce'].map((filter) => (
<button
key={filter}
onClick={() => setActiveFilter(filter)}
className={`px-6 py-2 ${
activeFilter === filter
? 'bg-indigo-100 text-indigo-600'
: 'bg-gray-100 hover:bg-indigo-100 text-gray-700 hover:text-indigo-600'
} rounded-full transition-colors duration-300 !rounded-button whitespace-nowrap cursor-pointer`}
>
{filter}
</button>
))}
</div>
{/* Projects Grid */}
<div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4 sm:gap-6 lg:gap-8">
{[
{
title: "E-commerce Dashboard",
description: "A responsive admin dashboard with advanced analytics and real-time data visualization.",
image: "https://readdy.ai/api/search-image?query=modern%20e-commerce%20dashboard%20UI%20with%20data%20visualization%20charts%20and%20graphs%2C%20clean%20interface%20with%20blue%20and%20white%20color%20scheme%2C%20professional%20web%20application%20screenshot%20with%20analytics%20panels%20and%20statistics%2C%20high%20quality%20UI%20design&width=600&height=450&seq=project-1&orientation=landscape",
tags: ["React", "TypeScript", "Tailwind CSS"],
demo: "#",
github: "#"
},
{
title: "Travel Booking Platform",
description: "A feature-rich travel booking application with interactive maps and payment integration.",
image: "https://readdy.ai/api/search-image?query=travel%20booking%20website%20interface%20with%20destination%20search%2C%20flight%20booking%20forms%2C%20and%20vacation%20packages%20display%2C%20modern%20UI%20with%20teal%20and%20white%20color%20scheme%2C%20professional%20web%20application%20screenshot%20with%20interactive%20elements%2C%20high%20quality%20UI%20design&width=600&height=450&seq=project-2&orientation=landscape",
tags: ["Vue.js", "Node.js", "MongoDB"],
demo: "#",
github: "#"
},
{
title: "Social Media App",
description: "A social networking platform with real-time messaging and content sharing capabilities.",
image: "https://readdy.ai/api/search-image?query=social%20media%20application%20interface%20with%20user%20profiles%2C%20news%20feed%2C%20and%20messaging%20features%2C%20modern%20UI%20with%20purple%20and%20white%20color%20scheme%2C%20professional%20web%20application%20screenshot%20with%20interactive%20elements%2C%20high%20quality%20UI%20design&width=600&height=450&seq=project-3&orientation=landscape",
tags: ["React", "Firebase", "Redux"],
demo: "#",
github: "#"
},
{
title: "Fitness Tracker",
description: "A comprehensive fitness tracking application with workout plans and progress visualization.",
image: "https://readdy.ai/api/search-image?query=fitness%20tracking%20application%20interface%20with%20workout%20plans%2C%20progress%20charts%2C%20and%20activity%20logs%2C%20modern%20UI%20with%20green%20and%20white%20color%20scheme%2C%20professional%20web%20application%20screenshot%20with%20interactive%20elements%2C%20high%20quality%20UI%20design&width=600&height=450&seq=project-4&orientation=landscape",
tags: ["Vue.js", "TypeScript", "Chart.js"],
demo: "#",
github: "#"
}
].filter(project =>
activeFilter === 'All' || project.tags.includes(activeFilter)
).map((project, index) => (
<div
key={index}
className="bg-white rounded-xl shadow-lg overflow-hidden transform transition-transform duration-300 hover:-translate-y-2"
>
<div className="h-56 overflow-hidden">
<img
src={project.image}
alt={project.title}
className="w-full h-full object-cover object-top transition-transform duration-500 hover:scale-105"
/>
</div>
<div className="p-6">
<h3 className="text-xl font-bold text-gray-800 mb-2">{project.title}</h3>
<p className="text-gray-600 mb-4">{project.description}</p>
<div className="flex flex-wrap gap-2 mb-4">
{project.tags.map((tag, tagIndex) => (
<span
key={tagIndex}
className="px-3 py-1 bg-indigo-100 text-indigo-600 text-sm rounded-full"
>
{tag}
</span>
))}
</div>
<div className="flex space-x-3">
<a
href={project.demo}
className="flex items-center text-indigo-600 hover:text-indigo-800 transition-colors cursor-pointer"
>
<i className="fas fa-external-link-alt mr-1"></i> Live Demo
</a>
<a
href={project.github}
className="flex items-center text-gray-700 hover:text-gray-900 transition-colors cursor-pointer"
>
<i className="fab fa-github mr-1"></i> GitHub
</a>
</div>
</div>
</div>
))}
</div>
<div className="text-center mt-12">
<button className="px-8 py-3 bg-indigo-600 hover:bg-indigo-700 text-white rounded-lg shadow-lg transition-all duration-300 !rounded-button whitespace-nowrap cursor-pointer">
View All Projects <i className="fas fa-arrow-right ml-2"></i>
</button>
</div>
</div>
</section>
    </div>
  )
}

export default Projects
